import React from "react";

const ProductSelf = () => {
  useEffect(() => {
    ProductService.getById(req.prams)
      .then((data) => {
        setProductData(data.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }, []);
  return <div>productSelf-component</div>;
};

export default ProductSelf;
